import React from 'react';
import { Canvas } from '@react-three/fiber';
import { OrbitControls, MeshDistortMaterial, Sphere } from '@react-three/drei';
import { motion } from 'framer-motion';

const TestComponent = () => {
  return (
    <div style={{ width: '100%', height: '100vh', display: 'flex', justifyContent: 'center', alignItems: 'center', backgroundColor: '#667eea' }}>
      <Canvas style={{ position: 'absolute', zIndex: 1 }}>
        <ambientLight intensity={0.5} />
        <pointLight position={[10, 10, 10]} />
        <Sphere args={[1, 100, 200]} scale={2}>
          <MeshDistortMaterial color="#8352fd" distort={0.5} speed={2} />
        </Sphere>
        <OrbitControls enableZoom={false} />
      </Canvas>

      <motion.h1
        initial={{ y: -250 }}
        animate={{ y: -10 }}
        transition={{ delay: 0.2, type: 'spring', stiffness: 120 }}
        style={{ color: 'white', zIndex: 2 }}
      >
        Welcome to FitLife
      </motion.h1>
    </div>
  );
};

export default TestComponent;
